/*Table structure for table `st_course` */

DROP TABLE IF EXISTS `st_course`;

CREATE TABLE `st_course` (
  `id` mediumint NOT NULL AUTO_INCREMENT COMMENT '课程id',
  `cou_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '课程名称',
  `cou_grade` double NOT NULL COMMENT '学分',
  `cou_time` mediumint NOT NULL COMMENT '学时',
  `major` varchar(20) NOT NULL COMMENT '所属专业',
  `ratio` double NOT NULL COMMENT '考试分占中成绩的比值',
  `cou_type` tinyint DEFAULT NULL COMMENT '课程类别（0:通识教育，1：专业基础课，2：专业核心课，3：专业实践课）',
  `cou_attribute` varchar(20) DEFAULT NULL COMMENT '课程属性',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=51 DEFAULT CHARSET=utf8mb3;

