/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `grade` AS select `s`.`stu_id` AS `stu_id`,`u`.`real_name` AS `real_name`,`u`.`stu_day` AS `stu_day`,`u`.`username` AS `username`,`c`.`cou_grade` AS `cou_grade`,`c`.`cou_type` AS `cou_type`,`s`.`grade` AS `grade`,`s`.`POINT` AS `point`,`m`.`name` AS `major_name`,`c`.`cou_name` AS `cou_name`,`r`.`major_id` AS `major_id`,`r`.`stu_year` AS `stu_year`,`t`.`cou_id` AS `cou_id`,rank() OVER (PARTITION BY `r`.`major_id`,`t`.`cou_id`,`r`.`stu_year`,`u`.`stu_day` ORDER BY `s`.`grade` desc )  AS `ranking` from (((((`stu_grade` `s` left join `st_user` `u` on((`s`.`stu_id` = `u`.`id`))) left join `st_class_room` `r` on((`s`.`room_id` = `r`.`id`))) left join `st_grade_tea` `t` on((`s`.`room_id` = `t`.`class_room_id`))) left join `st_major` `m` on((`u`.`major_id` = `m`.`id`))) left join `st_course` `c` on((`t`.`cou_id` = `c`.`id`))) group by `r`.`major_id`,`t`.`cou_id`,`r`.`stu_year`,`s`.`stu_id` */;

